css:
img{
  width:150px;
  border-radius:50%;    
  animation:anime 2s ease-in-out infinite;
}
@keyframes anime{
  0%{transform:rotate(0deg);margin-left:0%;}
  50%{transform:rotate(90deg);
    margin-left:50%;
    filter:blur(5px);   
  }
  75%{transform:rotate(180deg);
    margin-left:75%;    
   }  
  100%{
    transform:rotate(360deg);
    margin-left:100%;    
  }
}
